import { describe, expect, test } from 'vitest';
import { formatDate } from '../../../lib/util';
import { request } from '../../../__tests__/utils';
describe('others', () => {
    test('ok', async () => {
        const r1 = await request('http://unknownprotocol.w2.org/index.html?doNotParseJson');
        expect(r1.res.statusCode).toBe(502);
        formatDate();
        const r2 = await request('http://test.internal.path.com/...whistle-path.5b6af7b9884e1165...///whistle._abc/index.html');
        expect(r2.data.url).toBe('http://test.internal.path.com/...whistle-path.5b6af7b9884e1165...///whistle._abc/index.html');
    });
});
